window.bookSummaryJSON = "<p>Supervillains are murdering people in the streets, but yet superheroes are more concerned with gaining popularity than bringing the villains to justice.</p> <p>These villains think they are above the law and that nobody can stop them, but they never planned for me. I’ll murder every one of them with my powersuit, traps, and sidekicks.</p> <p>And if killing bad guys makes me a villain in the eyes of the heroes, well...I’ll destroy them too.</p>"; 
